    CMAP_FBUNICODELIST = {} # Reversed map of CMAP_FBGLYPHLIST
    GLYPHNAME_ALTERNATIVES = {} # Key is primary name. Value is list of alternative names.

    def makeCMAP_FBUNICODELIST(CMAP_FBGLYPHLIST, CMAP_FBUNICODELIST, GLYPHNAME_ALTERNATIVES):
        ALT_GLYPHNAMES = [] # Make local temp list, so we don't keep it after init.
        for u, glyphNames in CMAP_FBGLYPHLIST.items():

            for altName in glyphNames:
                if altName in GLYPHNAME_ALTERNATIVES:
                    GLYPHNAME_ALTERNATIVES[altName] += glyphNames
                else:
                    GLYPHNAME_ALTERNATIVES[altName] = glyphNames[:]

            primary = glyphNames[0]
            if primary in CMAP_FBUNICODELIST: # This should never be the case, but there is an unfixed anomaly for zerowidthjoiner
                ALT_GLYPHNAMES.append((primary, u))
            else:
                CMAP_FBUNICODELIST[primary] = [u]
            if len(glyphNames) > 1:
                for glyphName in glyphNames[1:]:
                    ALT_GLYPHNAMES.append((glyphName, u))

        for glyphName, u in ALT_GLYPHNAMES:
            if glyphName in CMAP_FBUNICODELIST:
                CMAP_FBUNICODELIST[glyphName].append(u)
            else:
                CMAP_FBUNICODELIST[glyphName] = [u]

